import React from "react";
const img="img/afsar.jpg"
const Resume =()=>{
    return (
        <>
                <h1>Resume</h1>
                <img src={img} alt="Afsar image" style={{height:"600px", borderRadius:"20px" , float:"left"}}></img>
                <h1>Personal Details</h1>
                <ul style={{ listStyleType: "none"}}>
                    <li>Name : <span style={{fontWeight:"700", color:"red"}}>Md Afsar</span></li>
                    <li>College Name: Alia</li>
                    <li>Stream : </li>
                    <li>Year-Of-Passing : </li>
                </ul>
                
        </>
    )
}
export default Resume;
